import Files from "./Files";

const Layout = props => (
  <div className="layout">
    {props.children}
    <Files />

    <style jsx>{`
      .layout {
        margin: 20 !important;
        background: green;
        padding: 20;
      }
    `}</style>
  </div>
);

export default Layout;
